import React,{ useState } from 'react';
import { Link } from 'react-router-dom';

function Login(){
    return(
        <div className='container d-flex justify-content-center align-items-center mx-auto vh-100 mb-4'>
            <div className='card mb-4' style={{width: "30rem", height: "30rem"}}>
                <form className='form-control d-flex flex-column justify-content-center align-items-center mb-4'>
                    <h1 className='d-flex justify-content-center align-items-center mx-auto my-4'>LOGIN</h1>
                    <input placeholder='E-mail' type='text' className='form-control form-control-lg mb-3'></input>
                    <input placeholder='Password' type='password' className='form-control form-control-lg mb-3'></input>
                    <button className='btn btn-lg btn-dark w-50 rounded my-2' type='submit'>Login</button>
                <p className='my-3'>Don't have an account. Sign Up</p>
                <Link to='/signup' className='btn btn-dark btn-lg w-50 rounded mb-4'>Sign Up</Link>
                </form>
            </div>
        </div>
    )
}

export default Login;
